import React from "react";
import "./styles.scss";
import ContentBlock from "../../components/ContentBlock/ContentBlock";
import strings from "../../en-NZ";
import ButtonGroup from "../../components/ButtonGroup/ButtonGroup";
import vuwwit from "../../images/work/vuwwit.png";

const buttonNames = ["All", "Design", "Development", "Community"];

const WorkSection = () => {
  return (
    <div className="work">
      <ContentBlock title={strings.work.title} />
      <ButtonGroup names={buttonNames} />

      <div className="hoverableimg">
        <img src="img_avatar.png" alt="Avatar" class="image" />
        <div class="overlay">
          <div class="text">Hello World</div>
        </div>
      </div>
    </div>
  );
};

export default WorkSection;
